import React from 'react';
import { Table } from 'react-bootstrap';


export default function TagTable(props) {
    console.log(props);
    const tags = props.tags;
    const tagsWrapped = tags.map(tag => <td>tag</td>);

    return (
        <Table>
            <tr>
                {tagsWrapped}
            </tr>
        </Table>
    );
}
